import React from 'react'
import Table from 'react-bootstrap/Table'
import Button from 'react-bootstrap/Button'

function Allstudents(props) {
    
    return (
            <Table striped bordered hover>
                <thead>
                    <tr>
                        <th>#</th>
                        <th>name</th>
                        <th>email</th>
                        <th>mobile</th>
                        <th>class</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        props.data.map((e,i) => {
                            return ( 
                                <tr key={i}>
                                    <td>{i+1}</td>
                                    <td>{e.name}</td>
                                    <td>{e.email}</td>
                                    <td>{e.mobile}</td>
                                    <td>{e.class}</td>
                                </tr>
                            );
                        })
                    }
             </tbody>
        </Table>
    );
}

export default Allstudents
